import math

def size(k):
    return int(math.log2(k))

def v2(k):
    if k % 2 != 1:
        return 0
    else:
        return 1 + v2(k // 2)

def find_magical_permutation(n, S):
    S.sort()
    used = []
    use = 0
    found = {0: 1}
    good = 0
    for guy in S:
        big = size(guy)
        if guy not in found:
            used.append(guy)
            use += 1
            new = []
            for boi in found:
                new.append(boi ^ guy)
            for guy in new:
                found[guy] = 1
            if use == big + 1:
                good = use
    if good == 0:
        return (0, [0])
    else:
        useful = used[:good]
        perm = [0]
        curr = 0
        for i in range(2 ** good - 1):
            curr ^= useful[v2(i + 1)]
            perm.append(curr)
        return (good, perm)

